import React from "react";
import Layout from "../components/layout";

const QueryForm = () => {
  return (
    <React.Fragment>
      <Layout>
        <h1>QueryForm Page</h1>
      </Layout>
    </React.Fragment>
  );
};

export default QueryForm;
